//////////////////////////////////////////////////////////////////////
// Purpose: Category Page Component
// Author: Siddharth Karanchery
//////////////////////////////////////////////////////////////////////

import React, { useEffect, useState } from "react";

import "./ContactUs.css";

function ContactUs(props) {
  const [mail, setMail] = useState({
    Name: "",
    Email: "",
    Subject: "",
    Message: "",
  });

  const onChange = (e) => {
    e.persist();

    setMail({ ...mail, [e.target.name]: e.target.value });
  };

  const onSubmit = (e) => {
    e.preventDefault();

    const data = {
      Name: mail.Name,
      Email: mail.Email,
      Password: mail.Subject,
      Message: mail.Message,
    };

    axios
      .post(apiUrl, data)

      .then((result) => {
        console.log(result);

        // alert("Thank you for registering!");
        // navigate("/Login");
      });
  };

  return (
    <div className="ContactUs">
      <div className="ContactUs__card">
        <div className="ContactUs__card__ele" id="card__ele">
          <h3>Contact Us</h3>
          <img
            className="ContactUs__card__ele__img"
            src="https://img.freepik.com/free-vector/users-with-speech-bubbles-vector_53876-82250.jpg?size=626&ext=jpg"
            alt=""
          />
        </div>
        <div className="ContactUs__card__ele" id="card__ele1">
          <Container>
            <Row className="justify-content-center">
              <Col md="12" lg="10" xl="8">
                <Card className="mx-4">
                  <CardBody className="p-4">
                    <Form onSubmit={InsertUser}>
                      <h1>Register</h1>

                      <InputGroup className="mb-3">
                        <Input
                          type="text"
                          name="Name"
                          id="Name"
                          placeholder="Name"
                          value={user.Name}
                          onChange={onChange}
                        />
                      </InputGroup>

                      <InputGroup className="mb-3">
                        <Input
                          type="email"
                          placeholder="Email"
                          name="Email"
                          id="Email"
                          value={user.Email}
                          onChange={onChange}
                        />
                      </InputGroup>

                      <InputGroup className="mb-3">
                        <Input
                          type="password"
                          placeholder="Password"
                          name="Password"
                          id="Password"
                          value={user.Password}
                          onChange={onChange}
                        />
                      </InputGroup>

                      <InputGroup className="mb-4">
                        <Input
                          type="text"
                          placeholder="Confirm Password"
                          name="ConfirmPass"
                          id="ConfirmPass"
                          value={user.ConfirmPass}
                          onChange={onChange}
                        />
                      </InputGroup>

                      <CardFooter className="p-4">
                        <Row>
                          <Col xs="12" sm="6">
                            <Button
                              type="submit"
                              className="btn btn-success mb-1"
                              block
                            >
                              <span>Register</span>
                            </Button>
                          </Col>

                          <Col xs="12" sm="6">
                            <Button
                              className="btn btn-light mb-1"
                              block
                              onClick={redirect}
                            >
                              <span>Cancel</span>
                            </Button>
                          </Col>
                        </Row>
                      </CardFooter>
                    </Form>
                  </CardBody>
                </Card>
              </Col>
            </Row>
          </Container>
        </div>
      </div>
    </div>
  );
}
export default ContactUs;
